Storyline:

     It is 1942 and the German submarine fleet is heavily engaged in the so called &quot;Battle of the Atlantic&quot; to harass and destroy British shipping. With better escorts of the Destroyer Class, however, German U-Boats have begun to take heavy losses. &quot;Das Boot&quot; is the story of one such U-Boat crew, with the film examining how these submariners maintained their professionalism as soldiers, attempted to accomplish impossible missions, while all the time attempting to understand and obey the ideology of the government under which they served.



